import React from 'react'
import Link from "./Link"

const links = [
  {id:"1", link: "#", name: "Home"},
  {id:"2", link: "#Search", name: "Search"},
  {id:"3", link: "#History", name: "History"}]

export default function Nav() {

  return (
    links.map(link => {
      return <Link key = {link.id} link = {link}/>
    })
  )
}
